肌美精 リンクルケア濃密潤い美容液 30mlは、<br /><br />4種の保湿成分に加えて11種のオーガニックモイスチャー成分配合。<br /><br /><br />たっぷりの美容成分をギュッと1滴に凝縮した美容液で角質層の最深層まで潤します。<br /><br />気になる目もと、口もとの乾燥による小じわを目立たなくします。<br /><br /><br /><br />【使用方法】<br /><br />・化粧水・乳液などで肌を整えた後、目元や口元の乾燥や乾燥による小じわの気になる部分に優しくなじませてください。<br /><br /><br />・朝晩お使いいただけます。<br /><br /><br />【注意事項】<br /><br /><br />・お肌に異常が生じていないかよく注意してください。お肌にあわないとき、傷、湿疹等異常のあるときは使用しないでください。<br /><br /><br />【配合成分】<br /><br />水、グリセリン、エタノール、DPG、PEG-75、パルミチン酸レチノール、<br /><br />ローヤルゼリーエキス、オウゴン根エキス、加水分解コラーゲン、ヒアルロン酸Na、<br /><br />プラセンタエキス（サケ）、ユズ果実エキス、ビルベリー果実エキス、サトウキビエキス、<br /><br />サトウカエデ樹液、オレンジ果実エキス、レモン果実エキス、ツボクサエキス、<br />イタドリ根エキス、カンゾウ根エキス、チャ葉エキス、ローズマリー葉エキス、<br /><br />カミツレ花エキス、アラリアエスクレンタエキス、ポリグリセリン-6、ソルビトール、<br /><br />PEG-60水添ヒマシ油、BG、カルボマー、キサンタンガム、スクワラン、フェニルトリメチコン、<br /><br />ポリソルベート20、マルチトール、水酸化K、トリ（カプリル酸／カプリン酸）グリセリル、<br />コーン油、EDTA-2Na、フェノキシエタノール、メチルパラベン<br /><br /><br /><br />製造元 クラシエホームプロダクツ株式会社<br /><br />JANコード：4901417621559 <br />商品番号：101-10798<br /><br /><br />（　肌美精　リンクルケア　美容液　濃密　化粧水　美容　オーガニック　凝縮　乳液　乾燥　小じわ　）<br /><br /><br /><br /><br /><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><br /><br /><style type="text/css">
